    [],nt"revision_timestamp": "2015-11-16T16:02:59.070603",nt"name": "nga-arctic-support-data-services",nt"isopen":
    false,nt"url": null,nt"notes": "NGA joined organizations from the National
    Science Foundation (NSF) and the United States Geological Survey (USGS) to partner
    with the University of Minnesota and other members of the academic research community,
    private sector and international partners. Together, these partners are working
    to create the first ever publicly available, high resolution, satellite-based elevation
    map of Alaska by mid-2016 and the entire Arctic by mid-2017. These initiatives by
    NGA support the US Chair of the Arctic Council and the Presidentu2019s Executive
    Order on Enhancing Coordination of National Efforts in the Arctic. These are Arctic
    data services that NGA is providing to the public and science community they are
    ESRI-based web services and are provisioned as (Map Services, Feature Services,
    WMS, and KML) capabilities.  Please provide any feedback to http://feedback.geointapps.org/",nt"license_title":
